import logo from './logo.svg';
import './App.css';

function App() {
  return (
      <body className='page'>
        <header class="header">
            <img src="<%=require('./images/logo__header.svg')%>" alt="Логотип" class="header__logo"/>
        </header>
      </body>
  );
}

export default App;
